-- Dumping structure for procedure jurnal_kelas.fill_date
DELIMITER //
CREATE PROCEDURE `fill_date`(
	IN `startdate` DATE,
	IN `stopdate` DATE







)
BEGIN DECLARE currentdate DATE;
SET 
  currentdate = startdate;
	WHILE currentdate <= stopdate DO 
		    YEAR(currentdate)* 10000 + MONTH(currentdate)* 100 + DAY(currentdate), 
		    currentdate, 
		    YEAR(currentdate), 
		    MONTH(currentdate), 
		    DAY(currentdate), 
		    QUARTER(currentdate), 
		    WEEKOFYEAR(currentdate), 
		    CASE DAYOFWEEK(currentdate)-1 
			 	WHEN 0 THEN 7 
				ELSE  DAYOFWEEK(currentdate)-1 END,
				 update_at = NOW()
		  ) ON DUPLICATE KEY UPDATE update_at = NOW();
	SET 
	  currentdate = ADDDATE(currentdate, INTERVAL 1 DAY);
	END WHILE;
END//
DELIMITER ;

